import React from "react";
import {Link} from "react-router-dom";
import {Row} from "react-bootstrap";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";


function PersonelNavigation() {
    return (
        <div>
            <Container fluid="md">
            <Col  style={{
                display: "flex",
                flexDirection:"column"
            }}>
                <Row style={{
                    display: "flex",
                    flexDirection:"column",
                    flex: 1,
                    justifyContent: "center",
                    alignItems: "center",
                    marginTop: "10vw",
                    marginBottom: "20vw"
                }}>
                    <Link to="PermissionFilling" style={{
                        textDecoration: "none",
                        display: "flex",
                        flex: 1,
                        height: "20vw",
                        flexWrap:"wrap"
                    }}  >
                        <button type="button" className="btn btn-success" style={{
                            display: "flex",
                            marginRight: "5px",
                            flex: 1,
                            height: "20vw",
                            justifyContent: "center",
                            borderRadius: "5%",
                            textAlign: "center",
                            fontWeight: "normal"
                        }}>
                            <h1 style={{
                                display: "flex",
                                flex: 1,
                                justifyContent: "center",
                                fontSize: "3vw",
                                margin: "auto"
                            }}>
                                İZİN TALEBİ YARAT
                            </h1>
                        </button>
                    </Link>
                    <Link to="PreviousPermissons" style={{
                        textDecoration: "none",
                        display: "flex",
                        flex: 1,
                        height: "20vw"
                    }}>
                        <button type="button" className="btn btn-success" style={{
                            display: "flex",
                            flex: 1,
                            height: "20vw",
                            borderRadius: "5%",
                            textAlign: "center",
                            justifyContent: "center"
                        }}>
                            <h1 style={{
                                display: "flex",
                                flex: 1,
                                justifyContent: "center",
                                fontSize: "3vw",
                                margin: "auto"
                            }}>
                                GEÇMİŞ İZİNLERİ GÖRÜNTÜLE
                            </h1>
                        </button>
                    </Link>
                </Row>
            </Col>
            </Container>
        </div>
    );
}


export default PersonelNavigation;
